import React from "react";
import { Route } from "react-router-dom";
import { Grid } from "semantic-ui-react";
import tumKampanyalar from "../pages/tumKampanyalar";

export default function KampanyaDashboard() {
  return (
    <div>
        <Grid.Row>
          <Grid.Column>
            <Grid.Column>
              <Route exact path="/tumkampanyalar" component={tumKampanyalar} />
            </Grid.Column>
          </Grid.Column>
        </Grid.Row>
    </div>
  );
}
